const generateCurrentYear=()=>{const e=document.getElementById("currentYear"),n=new Date;e.innerHTML=n.getUTCFullYear()};
const trackSocialLinksClick=()=>{const e=document.getElementById("socialButtons");function t(e){"A"===e.target.parentNode.tagName&&gtag("event","social_link_click",{socialLinkId:e.target.parentNode.id,url:e.target.parentNode.href})}e.removeEventListener("click",t),e.addEventListener("click",t)};